-- SEED after cleaning: TRUNCATE ... CASCADE then INSERTs
BEGIN;
TRUNCATE TABLE inventory_history, error_logs, ai_predictions, users, robots, products, warehouses, roles RESTART IDENTITY CASCADE;
COMMIT;


-- === Post-insert temporal fix ===
-- Ensure created_at is not earlier than scanned_at.
-- If created_at is NULL or earlier, set it to scanned_at + 1..120 minutes.
UPDATE inventory_history
SET created_at = scanned_at + ((1 + floor(random() * 120)) * interval '1 minute')
WHERE created_at IS NULL OR created_at < scanned_at;

-- (Optional) You can also guard against future created_at by capping at now():
-- UPDATE inventory_history
-- SET created_at = LEAST(created_at, now());
-- === FINAL PATCH: ensure statuses (either table), fix dates, classify month ===

-- 0) If в базе нет ни одной таблицы статусов — создаём минимальную public.inventory_statuses
DO $$
BEGIN
  IF to_regclass('public.inventory_statuses') IS NULL
     AND to_regclass('public.inventory_history_statuses') IS NULL THEN
    CREATE TABLE public.inventory_statuses (
      id   BIGSERIAL PRIMARY KEY,
      code VARCHAR(64)  NOT NULL UNIQUE,
      name VARCHAR(255) NOT NULL
    );
  END IF;
END $$ LANGUAGE plpgsql;


-- 1) Добавляем недостающие коды (динамически, без прямых ссылок на таблицу, чтобы не падало при её отсутствии)
DO $do$
BEGIN
  IF to_regclass('public.inventory_statuses') IS NOT NULL THEN
    EXECUTE 'INSERT INTO public.inventory_statuses(code,name)
             SELECT ''OK'',''В норме''
             WHERE NOT EXISTS (SELECT 1 FROM public.inventory_statuses WHERE code=''OK'')';
    EXECUTE 'INSERT INTO public.inventory_statuses(code,name)
             SELECT ''LOW_STOCK'',''Недостаток''
             WHERE NOT EXISTS (SELECT 1 FROM public.inventory_statuses WHERE code=''LOW_STOCK'')';
    EXECUTE 'INSERT INTO public.inventory_statuses(code,name)
             SELECT ''CRITICAL'',''Критично''
             WHERE NOT EXISTS (SELECT 1 FROM public.inventory_statuses WHERE code=''CRITICAL'')';
  END IF;

  IF to_regclass('public.inventory_history_statuses') IS NOT NULL THEN
    EXECUTE 'INSERT INTO public.inventory_history_statuses(code,name)
             SELECT ''OK'',''В норме''
             WHERE NOT EXISTS (SELECT 1 FROM public.inventory_history_statuses WHERE code=''OK'')';
    EXECUTE 'INSERT INTO public.inventory_history_statuses(code,name)
             SELECT ''LOW_STOCK'',''Недостаток''
             WHERE NOT EXISTS (SELECT 1 FROM public.inventory_history_statuses WHERE code=''LOW_STOCK'')';
    EXECUTE 'INSERT INTO public.inventory_history_statuses(code,name)
             SELECT ''CRITICAL'',''Критично''
             WHERE NOT EXISTS (SELECT 1 FROM public.inventory_history_statuses WHERE code=''CRITICAL'')';
  END IF;
END
$do$ LANGUAGE plpgsql;


-- 1) Добавляем недостающие коды — будет выполнено динамически ниже (для совместимости с разными именами таблиц).

-- (заменено на динамический INSERT для inventory_history_statuses)

-- 2) Получаем id нужных статусов (поддерживаем обе схемы именования) — без прямых ссылок на несуществующие таблицы
DO $do$
DECLARE
  ok_id  bigint;
  low_id bigint;
  crt_id bigint;
  from_utc timestamp;
  to_utc   timestamp;
BEGIN
  -- пытаться читать сначала из inventory_statuses (если есть)
  IF to_regclass('public.inventory_statuses') IS NOT NULL THEN
    SELECT id INTO ok_id  FROM public.inventory_statuses WHERE code='OK';
    SELECT id INTO low_id FROM public.inventory_statuses WHERE code='LOW_STOCK';
    SELECT id INTO crt_id FROM public.inventory_statuses WHERE code='CRITICAL';
  END IF;

  -- если каких-то не хватает, добираем из inventory_history_statuses (если есть)
  IF (ok_id IS NULL OR low_id IS NULL OR crt_id IS NULL)
     AND to_regclass('public.inventory_history_statuses') IS NOT NULL THEN
    IF ok_id IS NULL  THEN SELECT id INTO ok_id  FROM public.inventory_history_statuses WHERE code='OK'; END IF;
    IF low_id IS NULL THEN SELECT id INTO low_id FROM public.inventory_history_statuses WHERE code='LOW_STOCK'; END IF;
    IF crt_id IS NULL THEN SELECT id INTO crt_id FROM public.inventory_history_statuses WHERE code='CRITICAL'; END IF;
  END IF;

  IF ok_id IS NULL OR low_id IS NULL OR crt_id IS NULL THEN
    RAISE EXCEPTION 'Status IDs are missing (ok: %, low: %, critical: %).', ok_id, low_id, crt_id;
  END IF;

  -- 3) Чиним даты ГЛОБАЛЬНО (не только за месяц): created_at >= scanned_at
  UPDATE inventory_history
  SET created_at = scanned_at + ((1 + floor(random()*120)) * interval '1 minute')
  WHERE created_at IS NULL OR created_at < scanned_at;

  -- 4) Границы текущего месяца (Europe/Moscow -> UTC) для классификации
  SELECT (date_trunc('month', timezone('Europe/Moscow', now())) AT TIME ZONE 'UTC')::timestamp,
         ((date_trunc('month', timezone('Europe/Moscow', now())) + interval '1 month') AT TIME ZONE 'UTC')::timestamp
  INTO from_utc, to_utc;

  -- 5) CRITICAL: expected>0 and qty=0 OR difference <= -10
  UPDATE inventory_history h
     SET status_id = crt_id
   WHERE h.scanned_at >= from_utc AND h.scanned_at < to_utc
     AND ( (h.expected_quantity > 0 AND h.quantity = 0) OR h.difference <= -10 );

  -- 6) LOW_STOCK: difference -9..-1
  UPDATE inventory_history h
     SET status_id = low_id
   WHERE h.scanned_at >= from_utc AND h.scanned_at < to_utc
     AND h.difference BETWEEN -9 AND -1;

  -- 7) OK: если статус не установлен
  UPDATE inventory_history h
     SET status_id = ok_id
   WHERE h.scanned_at >= from_utc AND h.scanned_at < to_utc
     AND h.status_id IS NULL;
END
$do$ LANGUAGE plpgsql;
